template <> int rframe::bson_io::encode(rframe::bson_io::BsonObj & b, const gazebo_msgs::ODEPhysics & inobj, const char * name)
{
    int retval = Error::SUCCESS;

    BsonObj child;
    BsonObj * doc = &b;
    if (name != nullptr)
    {
        bson_append_document_begin(b,name,strlen(name),child);
        doc = &child;
    }

    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.auto_disable_bodies,"auto_disable_bodies");
    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.sor_pgs_precon_iters,"sor_pgs_precon_iters");
    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.sor_pgs_iters,"sor_pgs_iters");
    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.sor_pgs_w,"sor_pgs_w");
    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.sor_pgs_rms_error_tol,"sor_pgs_rms_error_tol");
    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.contact_surface_layer,"contact_surface_layer");
    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.contact_max_correcting_vel,"contact_max_correcting_vel");
    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.cfm,"cfm");
    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.erp,"erp");
    if (retval == Error::SUCCESS) retval = rframe::bson_io::encode(*doc,inobj.max_contacts,"max_contacts");

    if (name != nullptr)
    {
        bson_append_document_end(b,child);
    }

    return retval;
}

